package aoc2018

fun reducePolymers(s: String): Int {

  var counter = 1
  var s2 = s

  while (counter < s2.length) {
    if (s2[counter - 1].equalsOppositeCase(s2[counter])) {
      s2 = s2.removePolars(counter)
      counter = if (counter >= 1) 0 else counter - 2
    }
    counter++
  }

//  println(s2.length)
  return s2.length
}

fun String.removePolars(ind: Int): String {
  return if (ind == 0) {
    this.drop(2)
  } else {
    this.substring(0, ind - 1) + this.drop(ind + 1)
  }
}

fun Char.equalsOppositeCase(other: Char): Boolean {
  return (this.toUpperCase() == other || this.toLowerCase() == other) && this != other
}


fun main() {
  val s = ""

  val lengths = IntArray(26)
  for (i in 0..25){
    val replacable = 'a' + i
    val rep = s.replace(replacable.toString(), "", ignoreCase = true)
    lengths[i] = reducePolymers(rep)
  }
  println(lengths.min())
//  reducePolymers(s)
}
